import React from 'react'

const BtnBbw = props => {
    
    const content = (
        <div className={props.width + " " + props.height + " mb-4"}>
            <button
                className="w-full h-full bg-gray-900 hover:bg-gray-700 font-sans font-medium text-white text-sm py-2 px-4 mt-4 mb-4"
                type="button"
                onClick={props.onClick}
            >
                {props.value}
            </button>
        </div>
    )

    return content
}

export default BtnBbw
